description:
How wonderful is the life of a golden boy. Fame, wealth, women on such level that sometimes it may feel tiresome. But we think many out there who would take the 'burden'. Let's take Victor's example. He is handsome, wealthy, and he can bang two girls at the same time whenever he wants to... isn't that a sweet burden to take?


